import Button from 'react-bootstrap/Button';
import React, { Component } from 'react'

export default class My extends Component {
    constructor(props){
        super(props)
        this.state = {
            count:0
        }
    }
    incrementHandler=()=>{
        this.setState({
            count:this.state.count + 1
        })
    }
    decrementHandler=()=>{
        this.setState({
         count: this.state.count - 1
        })
    }
  render() {
       const {count} = this.state
    return (
      <div>
           <h1>Count: {count}</h1>
           <Button variant="secondary" onClick={this.incrementHandler}>+</Button>
           <Button variant="secondary"  className='m-2' onClick={this.decrementHandler}  disabled={count === 0 ? true:false} >-</Button>
      </div>
    )
  }
}
